import Navbar from 'components/Navbar';
import PatologiaCard from 'components/PatologiaCard';

const Patologia = () => {
  return (
    <>
      <Navbar />
      <div className="container my-4">
        <PatologiaCard />
      </div>
    </>
  );
};

export default Patologia;
